Bubble Sort Algorithm

Step 1: Start looping from with a variable called i the end of the array towards the beginning
for (let i = array.length; i > 0; i--) {

Step 2: Start an inner loop with a variable called j from the beginning until i - 1
for (let j = 0; j < i - 1; j++) {

Step 3: If arr[j] is greater than arr[j+1], swap those two values
if (array[j] > array[j+1]) {
let temp = array[j];
array[j] = array[j+1];
array[j+1] = temp;
}
  }
}

Step 4: Return the sorted array
return array;

